/* harmony default export */ __webpack_exports__["default"] = ("# Menu Multiselect\r\n\r\n## Type of Component\r\n\r\nVue Component - https://v1.vuejs.org/guide/components.html\r\n\r\n## Installation\r\n\r\n```bash\r\nnpm install @nasic/menu-multiselect@latest --save\r\n```\r\n\r\n## Purpose\r\n\r\nThis provides a parallel menu multi select. Similar to the Django Permissions widget.\r\n\r\n## Usage\r\n\r\n```html\r\n<menu-multi-select\r\n  @change=\"onChange\"\r\n  :height=\"height\"\r\n  :items=\"items\"\r\n  :flavor=\"flavor\"\r\n  v-model=\"selected\"\r\n></menu-multi-select>\r\n```\r\n\r\n```javascript\r\ndata: {\r\n    selected: [],\r\n    flavor: \"\",\r\n    height: \"100px\",\r\n    items: [\r\n        {\r\n            display: \"Item 1\",\r\n            value: \"1\"\r\n        },\r\n        {\r\n            display: \"Item 2\",\r\n            value: \"2\"\r\n        },\r\n        {\r\n            display: \"Item 3\",\r\n            value: \"3\"\r\n        },\r\n        {\r\n            display: \"Item 4\",\r\n            value: \"4\"\r\n        }\r\n        ]\r\n}\r\n```\r\n\r\n## Configuration\r\n\r\nVarious Vue Component Props have been exposed for customizing the behavior of the component.\r\n\r\nSpecial note: camelCase props need to be converted to kebab-case when being set.\r\n\r\n<table>\r\n    <thead>\r\n        <tr>\r\n            <th>Prop Name</th>\r\n            <th>Type</th>\r\n            <th>Default</th>\r\n            <th>Purpose</th>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td>height</td>\r\n            <td>`String`</td>\r\n            <td>`\"100px\"`</td>\r\n            <td>Controls the height of the menu. The menu will auto overflow additional items</td>\r\n        </tr>\r\n        <tr>\r\n            <td>flavor</td>\r\n            <td>`String`</td>\r\n            <td>`\"\"`</td>\r\n            <td>Controls the flavor of the badges and buttons</td>\r\n        </tr>\r\n        <tr>\r\n            <td>items</td>\r\n            <td>`Array`</td>\r\n            <td>`[]`</td>\r\n            <td>This is the items that should be displayed. Expects objects of the following format<br>\r\n            <pre>\r\n                <code>\r\n                    {\r\n                        display: String,\r\n                        value: Any-primitive-or-date-that-can-be-compared-with-equals-equals\r\n                    }\r\n                </code>\r\n            </pre></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n\r\n## Events\r\n\r\n<table>\r\n    <thead>\r\n        <tr>\r\n            <th>Event</th>\r\n            <th>Bind Attribute</th>\r\n            <th>Payload</th>\r\n            <th>Description</th>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td>`change`</td>\r\n            <td>`@change`</td>\r\n            <td>Currently Selected Options</td>\r\n            <td>Fired on selection</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n");

