/* harmony default export */ __webpack_exports__["default"] = ("# Tabs\r\n\r\n## Type of Component\r\n\r\nVue Component - https://v1.vuejs.org/guide/components.html\r\n\r\n## Installation\r\n\r\n```bash\r\nnpm install @IntusFacultas/tabs@latest --save\r\n```\r\n\r\n## Purpose\r\n\r\nThis provides a configurable tabs component with theming\r\n\r\n## Usage\r\n\r\n```html\r\n<tabs :flavor=\"flavor\" :tabs=\"tabs\" @select=\"onSelect\"></tabs>\r\n```\r\n\r\n```javascript\r\nimport Tabs from \"@IntusFacultas/tabs\";\r\ndata: {\r\n    flavor: \"\",\r\n    tabs: [\r\n        {\r\n            text: \"Link 1\",\r\n            value: \"link1\",\r\n            type: \"tab\",\r\n            html: \"\",\r\n            active: true,\r\n            disabled: false,\r\n        },\r\n        {\r\n            text: \"Link 2 (Im an href)\",\r\n            value: \"link1\",  // the href\r\n            type: \"link\",\r\n            html: ``,\r\n            active: false,\r\n            disabled: false,\r\n        },\r\n        {\r\n            text: \"Link 3\",\r\n            value: \"link3\",\r\n            type: \"tab\",\r\n            html: \"\",\r\n            active: false,\r\n            disabled: true,\r\n        },\r\n        {\r\n            text: \"Link 4\",\r\n            value: \"link4\",\r\n            type: \"tab\",\r\n            html: \"\",\r\n            active: false,\r\n            disabled: false,\r\n        },\r\n        {\r\n            text: \"Link 5\",\r\n            value: \"link5\",\r\n            type: \"tab\",\r\n            html: \"\",\r\n            active: false,\r\n            disabled: false,\r\n        }\r\n    ]\r\n}\r\n```\r\n\r\n## Configuration\r\n\r\nVarious Vue Component Props have been exposed for customizing the behavior of the component.\r\n\r\nSpecial note: camelCase props need to be converted to kebab-case when being set.\r\n\r\n<table>\r\n    <thead>\r\n        <tr>\r\n            <th>Prop Name</th>\r\n            <th>Type</th>\r\n            <th>Default</th>\r\n            <th>Purpose</th>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td>tabs</td>\r\n            <td>`Array`</td>\r\n            <td>[]</td>\r\n            <td>The tabs to be displayed. Reference the usage exmaple above for the format</td>\r\n        </tr>\r\n        <tr>\r\n            <td>flavor</td>\r\n            <td>`String`</td>\r\n            <td>`Dark`</td>\r\n            <td>Controls what flavor should be applied to the tab</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n\r\n## Events\r\n\r\n<table>\r\n    <thead>\r\n        <tr>\r\n            <th>Event</th>\r\n            <th>Bind Attribute</th>\r\n            <th>Payload</th>\r\n            <th>Description</th>\r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td>`select`</td>\r\n            <td>`@select`</td>\r\n            <td>Selected Tab</td>\r\n            <td>Fired on selection of tab</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n");

